import Header from "../component/header/Header";
import Nav from "../component/navbar/Nav";
import fond from "../Background.png";
function Home() {
	return (
		<div className='App'>
			<div
				style={{
					backgroundImage: `url(${fond})`,
					height: "37rem",
					backgroundPosition: "center",
				}}
			>
				<Nav />
				<Header />
			</div>
		</div>
	);
}

export default Home;
